style.css:
/* Set the background color to light pink */
body {
  background-color: #ffc0cb;
}

/* Set text color to baby blue */
body, h1, h2, p {
  color: #a0d6f7;
}

/* Style links and buttons */
a, button {
  background-color: #a0d6f7;
  color: #fff;
  padding: 10px 20px;
  border: none;
  text-decoration: none;
  border-radius: 5px;
}

/* Hover effect for links and buttons */
a:hover, button:hover {
  background-color: #5aafe3;
}
